import type { AppProps } from "next/app";
import Home from ".";
import "../styles/globals.css";

export default function App({ Component, pageProps }: AppProps) {
  return (
    <div>
      <div className="flex">
        <div className="flex-col mb-10">
          <h1 className="text-3xl">Burger</h1>
          <ul className="flex-row inline-block justify-center">
            <li className="pr-2">Hjem</li>
            <li className="pr-2">Om oss</li>
            <li className="pr-2">Tilbud</li>
            <li className="pr-2">Meny</li>
            <li>Kontakt oss</li>
          </ul>
        </div>
      </div>
      <div>
        <Home />
      </div>
    </div>
  );
}
